import "./BoxRHS.css";

const BoxRHS = () => {
    return(
        <div className="BoxRHSBody">
            <form>
                EMAIL <br/>
                <input type="Email" placeholder="Enter Email ID" /> <br/>
                Password <br/>
                <input type="password" placeholder="Enter Password" />
                                
            </form>          
            
        </div>
    );
}

export default BoxRHS;


